// Export all icons as a map for easy access
export const ProviderIcons = {
	anthropic: AnthropicIcon,
	cloudrift: CloudriftIcon,
	deepseek: DeepseekIcon,
	"google-ai-studio": GoogleStudioAIIcon,
	groq: GroqIcon,
	"inference.net": InferenceNetIcon,
	mistral: MistralIcon,
	openai: OpenAIIcon,
	perplexity: PerplexityIcon,
	"together.ai": TogetherAIIcon,
	xai: XAIIcon,
	moonshot: MoonshotIcon,
	novita: NovitaIcon,
	alibaba: AlibabaIcon,
	nebius: NebiusIcon,
	zai: ZaiIcon,
	routeway: RoutewayIcon,
	"routeway-discount": RoutewayIcon,
	nanogpt: NanoGPTIcon,
	"aws-bedrock": AWSBedrockIcon,
	azure: AzureIcon,
	canopywave: CanopyWaveIcon,
} as const;

// Type for provider icon keys
export type ProviderIconKey = keyof typeof ProviderIcons;

// Helper function to get an icon by provider name
export const getProviderIcon = (
	provider: string,
): React.FC<React.SVGProps<SVGSVGElement>> | null => {
	// First try the exact provider name (for keys like "together.ai", "inference.net")
	if (ProviderIcons[provider as ProviderIconKey]) {
		return ProviderIcons[provider as ProviderIconKey];
	}

	// Then try normalized version (for other provider names)
	const normalizedProvider = provider
		.toLowerCase()
		.replace(/[^a-z0-9]/g, "-") as ProviderIconKey;
	return ProviderIcons[normalizedProvider] || null;
};
